MMA fighter and gypsy John Maguire says people were trying to be "offended on the gypsy community’s behalf" by Jimmy Carr's controversial Holocaust joke.

“MPs coming out saying they’re outraged but they wouldn’t spit on us if we were on fire.”

@RobbieRinder | @MaguireTheOne https://t.co/fuTwl5QWSG

MMA fighter and gypsy John Maguire says he continues to encounter prejudice against the gypsy community, as the row over Jimmy Carr’s Holocaust joke continues.

“You can go to a pub that still won’t serve a gypsy or traveller in this day and age.”

@RobbieRinder | @MaguireTheOne https://t.co/GPuTKcjc6P

